import React, { useState, useEffect } from "react";
import { Link } from "react-dom";
import { getManyByTitle } from "../hooks/hooks";
import { Movie } from "./Movie";

export const Movies = () => {
  const [movies, setMovies] = useState([]);

  useEffect(() => {
    getManyByTitle("superman").then((movies) => setMovies(movies));
  }, []);

  console.log(movies);

  return (
    <>
      {movies.map((movie) => {
        return (
          <section key={movie.imdbID}>
            <h1>{movie.Title}</h1>
            <img src={movie && movie.Poster} />
            <h3>{movie.Year}</h3>
          </section>
        );
      })}
    </>
  );
};
